CREATE TABLE public.customers
(
    customer_id integer NOT NULL,
    first_name text COLLATE pg_catalog."default" NOT NULL,
    last_name text COLLATE pg_catalog."default" NOT NULL,
    street text COLLATE pg_catalog."default" NOT NULL,
    housenumber text COLLATE pg_catalog."default" NOT NULL,
    po integer NOT NULL,
    city text COLLATE pg_catalog."default" NOT NULL,
    state text COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT customers_pkey PRIMARY KEY (customer_id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.customers
    OWNER to postgres;

CREATE TABLE public.products
(
    product_id integer NOT NULL,
    product_category_id integer NOT NULL,
    product_name text COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT products_pkey PRIMARY KEY (product_id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.products
    OWNER to postgres;



CREATE TABLE public.product_categories
(
    product_category_id integer NOT NULL,
    product_category_name text COLLATE pg_catalog."default" NOT NULL,
    CONSTRAINT product_categories_pkey PRIMARY KEY (product_category_id)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.product_categories
    OWNER to postgres;





CREATE TABLE  public.invoices
(
    date text COLLATE pg_catalog."default" NOT NULL,
    customer_id integer NOT NULL,
    invoice_id integer NOT NULL,
    product_id integer NOT NULL,
    number_items integer NOT NULL,
    price_per_item double precision NOT NULL
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public.invoices
    OWNER to postgres;

